INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (214921,'https://live.linkedtrust.us/claims/118500','rated','CLAIM',NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('On the 3rd of March 2024, I visited AMURT in Ebonyi, Nigeria to check out the facilities and work they do. I was blowed away by their achievement due the way they converted health centers to a mini hospital. I spoke with some beneficiary of this project and not only them but the community has been glad since the beginning of the project.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('I visited some health center and check them out.','https://trustclaims-images.s3.us-west-1.amazonaws.com/IMG_20240503_144203.jpeg',NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (214922,'https://live.linkedtrust.us/claims/118501','rated','CLAIM',NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('On the 3rd of May, 2024, I visit AMURT in Ebonyi, Nigeria. I was blown away with what they are doing and have done there. They have succeeded in converting some local health center to a standard ones.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('I visited some of their health centers and spoke with some beneficiaries, not only the beneficiaries but also the communities was happy with the project so far.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('Their impact on the people of Ebonyi have been great.','https://trustclaims-images.s3.us-west-1.amazonaws.com/1714738074246.jpeg',NULL);
