INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (214991,'https://www.amurt.net','AMURT Disaster Relief – Development Cooperation','ORGANIZATION',NULL,NULL,NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (214992,'https://live.linkedtrust.us/claims/118499','impact','CLAIM',NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('In Ebonyi, Nigeria, Amurt ( which is the organization that works in providing help to people) work to provide good health to people of Ebonyi state.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The work with hospitals within the state to achieve this. They have been doing since 2010.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The help to provide solid health care to baby and mother that have complication in child delivery. They foot the bills and make sure that both the mother and child are healthy as they stay in the hospital.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('They also cater for care that are extreme and need treatment asap by using their ambulance for quick response. They can also pay for the bills for this too.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('Sometime they visit hospital to fund people that can pay for their bills so that can be discharged. They have representative of themselves in several hospital and they are across the state of Ebonyi.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('In summary, they exist to make sure people have a sound health care with small or no cost.',NULL,NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (214995,'https://live.linkedtrust.us/claims/118546','rated','CLAIM',NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('My name is Ani Peter Benjamin, and I am a software engineer with the LinkedTrust team. In early May 2024, I traveled to Ebonyi State with Orjiene Kenechukwu to observe the remarkable work being done by AMURT in the community. As a Nigerian, I am delighted to see the significant improvements in underdeveloped communities.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('AMURT's strategies to combat poverty in rural areas, such as providing innovative cooperative ideas, have greatly assisted local women in taking better care of their families. Additionally, AMURT has established awareness groups to educate women on proper childbearing practices and to engage the youth in educational initiatives.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The impact of AMURT's efforts on Ebonyi State has been profoundly positive, especially in their health centers. I am personally impressed and supportive of the progress they have made.','https://trustclaims-images.s3.us-west-1.amazonaws.com/IMG_20240503_130439.jpeg',NULL);
