INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118499,'https://www.amurt.net','impact',NULL,'In Ebonyi, Nigeria, Amurt ( which is the organization that works in providing help to people) work to provide good health to people of Ebonyi state.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The work with hospitals within the state to achieve this. They have been doing since 2010.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The help to provide solid health care to baby and mother that have complication in child delivery. They foot the bills and make sure that both the mother and child are healthy as they stay in the hospital.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('They also cater for care that are extreme and need treatment asap by using their ambulance for quick response. They can also pay for the bills for this too.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('Sometime they visit hospital to fund people that can pay for their bills so that can be discharged. They have representative of themselves in several hospital and they are across the state of Ebonyi.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('In summary, they exist to make sure people have a sound health care with small or no cost.','2024-05-03 15:05:34.054','https://www.amurt.net/safeguarding-the-lives-of-women-and-children/','SECOND_HAND',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.85,'_','URL','kjzl6kcym7w8yasmlebdhlqgcnu0b791keuex8qg970irc6331b61njy0cjp2xn',NULL,'2024-05-03 15:06:40.545','2024-05-03 15:06:40.544');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118500,'https://live.linkedtrust.us/claims/118499','rated',NULL,'On the 3rd of March 2024, I visited AMURT in Ebonyi, Nigeria to check out the facilities and work they do. I was blowed away by their achievement due the way they converted health centers to a mini hospital. I spoke with some beneficiary of this project and not only them but the community has been glad since the beginning of the project.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('I visited some health center and check them out.','2024-05-04 12:21:01.188',NULL,'FIRST_HAND',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://trustclaims.whatscookin.us/users/105','URL','kjzl6kcym7w8y4xdy6238753aygf5g4ccvy8mqm33l7ihs5yysvazjv5tpy89dz',NULL,'2024-05-04 12:47:43.279','2024-05-04 12:47:43.279');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118501,'https://live.linkedtrust.us/claims/118499','rated',NULL,'On the 3rd of May, 2024, I visit AMURT in Ebonyi, Nigeria. I was blown away with what they are doing and have done there. They have succeeded in converting some local health center to a standard ones.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('I visited some of their health centers and spoke with some beneficiaries, not only the beneficiaries but also the communities was happy with the project so far.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('Their impact on the people of Ebonyi have been great.','2024-05-04 12:48:07.204','https://www.linkedin.com/in/kenechukwu-orjiene/',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://trustclaims.whatscookin.us/users/105','URL',NULL,NULL,'2024-05-04 13:03:54.38','2024-05-04 13:03:54.38');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118502,'https://www.amurt.net/safeguarding-the-lives-of-women-and-children/','impact',NULL,NULL);
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('Peter and I visited AMURT in Ebonyi, Nigeria, representing Voice of a Child via LinkedTrust. We were warmly welcomed by Dada. During our visit, we met with key individuals including Dada, Peter, the COO, and heads of various departments. We learned about their collaboration with the Government and Community to provide high-quality healthcare services, especially focusing on maternal and child health. Our visit to health centers showcased their dedication. We spoke with beneficiaries and learned about the impact of AMURT's initiatives, including economic empowerment through cooperative management schemes and increased healthcare utilization rates through outreach efforts. AMURT's holistic approach includes surgical interventions for children. Our visit left us inspired by their commitment to transforming lives, and we anticipate continued collaboration in advancing healthcare and socioeconomic development in Ebonyi and beyond.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('https://www.linkedin.com/feed/update/urn:li:activity:7192648658339647488/','2024-05-04 13:07:40.651','https://www.linkedin.com/in/kenechukwu-orjiene/','FIRST_HAND',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0.9,'_','URL','kjzl6kcym7w8y7nnidtnxkpmnjyw2oc1ifmatgyfni5bz5tdkejuze4m6nos5gj',NULL,'2024-05-04 22:20:44.54','2024-05-04 22:20:44.54');
