INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118509,'https://live.linkedtrust.us/claims/118502','rated',NULL,'This is Dada. I received Kene and Peter at the motor park in Ebonyi and took them to AMURT office to introduce them to some of AMURT key staff.  Kene and Peter visited Odeligbo Health Center in Ikwo LGA and Ephuenyim Health Center in Abakaliki LGA accompanied by Medical Director Dr. Opoke and COO Ogbonna Agha.  They met staff, patients and their families and some community members.  The model for the Economic Empowerment Scheme is described as a "Cooperatively managed revolving credit scheme'.  ','2024-05-14 18:46:11.095',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://trustclaims.whatscookin.us/users/114','URL','kjzl6kcym7w8y5b2zs15g62c7i3fv7v9a13ivest3kd2jcfjd0utcpanvmp3peu',NULL,'2024-05-14 18:55:45.94','2024-05-14 18:55:45.94');
