INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118541,'https://www.amurt.net','rated',NULL,'I know several of the people involved with AMURT and trust that they are genuine and ethical people, because I have also seen the impact of their other projects with people I know.  In particular I have very high confidence in Kirit  Dave as I am familiar with a kindergarten he started in Jarablus','2024-05-21 09:37:59.07','https://www.linkedin.com/in/goldavelez/','SECOND_HAND',NULL,NULL,NULL,NULL,'impact:social',NULL,5,NULL,NULL,NULL,NULL,NULL,0.95,'_','URL',NULL,NULL,'2024-05-21 09:40:26.256','2024-05-21 09:40:26.256');
