INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118546,'https://live.linkedtrust.us/claims/118499','rated',NULL,'My name is Ani Peter Benjamin, and I am a software engineer with the LinkedTrust team. In early May 2024, I traveled to Ebonyi State with Orjiene Kenechukwu to observe the remarkable work being done by AMURT in the community. As a Nigerian, I am delighted to see the significant improvements in underdeveloped communities.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('AMURT's strategies to combat poverty in rural areas, such as providing innovative cooperative ideas, have greatly assisted local women in taking better care of their families. Additionally, AMURT has established awareness groups to educate women on proper childbearing practices and to engage the youth in educational initiatives.');
INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES ('The impact of AMURT's efforts on Ebonyi State has been profoundly positive, especially in their health centers. I am personally impressed and supportive of the progress they have made.','2024-05-27 10:47:08.728',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'http://trustclaims.whatscookin.us/users/6','URL',NULL,NULL,'2024-05-27 10:54:53.868','2024-05-27 10:54:53.868');
