INSERT INTO "None" ("id","nodeUri","name","entType","descrip","image","thumbnail") VALUES (118550,'https://voiceofachild.org','impact','https://www.amurt.net','Voice of a Child is one of the largest cash contributors to the AMURT Nigeria projects since its inception. Through our fundraising and cash contributions, they have impacted over $50,000 in cash. Additionally, they have contributed significantly towards medical ultrasound machines and ambulances.','2024-06-07 14:09:41.437','https://voiceofachild.org/whoweare/our-board/#:~:text=Kirit%20Dave','SECOND_HAND',NULL,NULL,NULL,NULL,NULL,NULL,NULL,50000,NULL,NULL,NULL,NULL,0.9,'_','URL',NULL,NULL,'2024-06-07 15:19:46.311','2024-06-07 15:19:46.311');
